var title_f11_40_11905="Lateral recumbent position for lumbar puncture";
var content_f11_40_11905=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F60862&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F60862&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Lateral recumbant position",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 410px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The child is positioned near the edge of the examining table. The assistant places one arm around the posterior aspect of the child's neck and the other arm under the child's knees to hold the child in optimal position. The child's hips and shoulders should be kept perpendicular to the table in order to maintain spinal alignment without rotation. The assistant can maintain adequate restraint by holding onto his or her own wrists.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from Cronan, KM, Wiley, JF. Lumbar puncture. In: Henretig, FM, King, C, (Eds), Textbook of Pediatric Emergency Procedures, Williams and Wilkins, Baltimore, 1997.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
