"        <p>",
"         12 g/m",
"         <sup>",
"          2",
"         </sup>",
"         (&le;12 years old)",
"        </p>",
"       </td>",
"       <td>",
"        NR",
"       </td>",
"       <td>",
"        NR",
"       </td>",
"       <td>",
"        20",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
