"         2",
"        </sup>",
"       </td>",
"       <td>",
"        4",
"       </td>",
"       <td>",
"        15 mg&nbsp;every six&nbsp;hours&nbsp;for 10 doses",
"       </td>",
"       <td>",
"        24",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ferrari S; 2005",
"        <sup>",
